B.N1=new A.et("9f34cb46-0a99-4eb4-b73a-c3b84d51ee66","CompressIt","**CompressIt** is a compression and conversion app that I developed using the Flutter framework. It is a powerful tool that allows users to shrink the size of their images and audio files without losing quality. CompressIt works locally on the user's device, so there is no need to upload files to a server or share them with anyone else.\n\nCompressIt supports a variety of image and audio formats, including JPEG, PNG, HEIC, WebP, MP3, AAC, and WAV. Users can compress files individually or in batches. CompressIt also allows users to set custom compression levels to achieve the desired balance between file size and quality.\n\n**Here are some of the features of CompressIt:**\n\n* Supports a variety of image and audio formats\n* Allows users to compress files individually or in batches\n* Allows users to set custom compression levels\n* Works locally on the user's device\n* Easy to use\n* Free and open source\n\n**I am proud of the work I did on CompressIt. It is a powerful tool that can be used by anyone to save space on their device, send large files more easily, and improve the performance of their apps.**\n\n**Here are some additional details about the use of Flutter in CompressIt:**\n\n* Flutter is a cross-platform framework, which means that the same code can be used to build apps for both Android and iOS.\n* Flutter is known for its high performance and beautiful UIs.\n* CompressIt uses many of the features of Flutter, such as its declarative UI, its hot reload feature, and its internationalization support.\n\nI believe that the use of Flutter in CompressIt has made the app more powerful, more user-friendly, and more accessible to a wider range of users.\n","A compression and convertion App for images (JPEG, PNG, HEIC, and WebP) and audio locally without server","https://github.com/azliR/flutter_compress_it",B.Hy,B.GW,B.GH,B.Kq,B.Ho,!1)
