B.N_=new A.et("613b4548-f921-40a6-b6e0-1e99d39e58d9","Murojaah Web","**Murojaah Web** is a web app that collects sample dataset for the Murojaah-ml machine learning model. The app is built with Flutter, Firebase Firestore, Firebase Storage, and Firebase Auth. It only collects verse number, ayah number, recording, and timestamp for the Murojaah-ml project. The data is stored securely in Firebase.\n\n**Features:**\n\n* Collects sample dataset for the Murojaah-ml machine learning model.\n* Only collects verse number, ayah number, recording, and timestamp.\n* Stores data securely in Firebase.\n\n**Benefits:**\n\n* Provides a convenient way to collect sample data for the Murojaah-ml model.\n* Helps to ensure that the data is accurate and consistent.\n* Makes it easier to train and deploy the Murojaah-ml model.\n\n**Use cases:**\n\n* Personal use: Muslims can use Murojaah Web to collect sample data for the Murojaah-ml model on their own.\n* Educational use: Schools and mosques can use Murojaah Web to teach their students how to collect sample data for the Murojaah-ml model.\n* Research use: Researchers can use Murojaah Web to study the Quranic recitation and to develop new machine learning models for classifying Quranic verses.\n","A web app built using Flutter with Firebase Firestore, Storage, and Auth to collect sample dataset for the Murojaah-ml machine learning model","https://github.com/azliR/flutter_murojaah-web",B.I7,B.GX,B.n6,null,B.Hc,!0)
